import React from 'react';
import './navbar.css';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'; // Importando FontAwesome
import { faHome, faInfoCircle, faQuestionCircle } from '@fortawesome/free-solid-svg-icons'; // Ícones

const Navbar = () => {
  return (
    <nav className="navbar">
      <div className="navbar-container">
        {/* Logo da Navbar */}
        <a href="/" className="navbar-logo" aria-label="Logo do Conversor de Arquivos">
          Conversor de Arquivos
        </a>

        {/* Menu da Navbar */}
        <ul className="navbar-menu">
          <li className="navbar-item">
            <a href="/" className="navbar-link" aria-label="Página Inicial">
              <FontAwesomeIcon icon={faHome} /> Início
            </a>
          </li>
          <li className="navbar-item">
            <a href="/about" className="navbar-link" aria-label="Sobre o Conversor">
              <FontAwesomeIcon icon={faInfoCircle} /> Sobre
            </a>
          </li>
          <li className="navbar-item">
            <a href="/help" className="navbar-link" aria-label="Ajuda">
              <FontAwesomeIcon icon={faQuestionCircle} /> Ajuda
            </a>
          </li>
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
